import { useState } from 'react';

function List() {
    const [arr, setArr] = useState([12, 45, 67]);
    return (
        <div>
            <ul>
                {arr.map((el, index) => {
                    return <li key={index}>{el}</li>
                })}

            </ul>
        </div>
    );
}

export default List;
